import AdminNavbar from "./adminNavbar";

const AdminHome = () => {
    return ( 
        <div className="adminHome">
            <h1>AdminPortal</h1>
            <div className="links">
             <a href="">Add Books</a>
             <a href="">Add Users</a>
             <a href="">Book List</a>
             <a href="">Users List</a>
             <a href="">Logout</a>
            </div>
            <AdminNavbar/>
        </div>
     ); 
}
 
export default AdminHome;
